//引入路由组件
import Home from '@/pages/Home'
import Search from '@/pages/Search'
import Login from '@/pages/Login'
import Register from '@/pages/Register'
import Detail from "@/pages/Detail"
import AddCartSuccess from "@/pages/AddCartSuccess"
import ShopCart from "@/pages/ShopCart"
import Trade from "@/pages/Trade"
import Pay from "@/pages/Pay"

// 配置路由
export default [

    {
        path: '/pay',
        name: 'Pay',
        component: Pay,
        meta: { show: true }

    },

    {
        path: '/trade',
        name: 'Trade',
        component: Trade,
        meta: { show: true }

    },
    {
        path: '/shopcart',
        name: 'ShopCart',
        component: ShopCart,
        meta: { show: true }
    },


    {
        path: '/addcartsuccess',
        name: 'AddCartSuccess',
        component: AddCartSuccess,
        meta: { show: true }
    },

    {
        // 路由跳转的时候需要拿到参数
        path: '/detail/:skuid',
        name: 'Detail',
        component: Detail,
        meta: { show: true }


    },
    {
        path: '/home',
        name: 'Home',
        component: Home,
        meta: { show: true },

    },
    {
        path: '/search/:keyword?',
        name: 'Search',
        component: Search,
        meta: { show: true }
    },
    {
        path: '/login',
        name: 'Login',
        component: Login,
        meta: { show: false }
    },
    {
        path: '/register',
        name: 'Register',
        component: Register,
        meta: { show: false }
    },
    // 重定向
    {
        path: '*',
        redirect: '/home'
    }

]
